import React, { useEffect, useState } from "react";
import axios from "axios";

function ComplaintsTable() {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/complaints")
      .then((res) => {
        setComplaints(res.data);
      })
      .catch((err) => {
        console.error("Error fetching complaints:", err);
      });
  }, []);

  return (
    <div className="max-w-7xl mx-auto px-4 py-10">
      <h1 className="text-3xl font-bold mb-6 text-center">Complaints Dashboard</h1>
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white shadow-md rounded-lg overflow-hidden">
          <thead className="bg-gray-100">
            <tr>
              <th className="text-left px-6 py-4">ID</th>
              <th className="text-left px-6 py-4">Name</th>
              <th className="text-left px-6 py-4">Location</th>
              <th className="text-left px-6 py-4">Department</th>
              <th className="text-left px-6 py-4">Status</th>
              <th className="text-left px-6 py-4">Token</th>
              <th className="text-left px-6 py-4">Timestamp</th>
            </tr>
          </thead>
          <tbody>
            {complaints.length > 0 ? (
              complaints.map((c) => (
                <tr key={c.id} className="border-t hover:bg-gray-50 transition">
                  <td className="px-6 py-4">{c.id}</td>
                  <td className="px-6 py-4">{c.name}</td>
                  <td className="px-6 py-4">{c.location}</td>
                  <td className="px-6 py-4">{c.department}</td>
                  <td
                    className={`px-6 py-4 font-semibold ${
                      c.status === "Resolved" ? "text-green-600" : "text-yellow-600"
                    }`}
                  >
                    {c.status}
                  </td>
                  <td className="px-6 py-4 text-xs text-gray-600">{c.token}</td>
                  <td className="px-6 py-4">
                    {new Date(c.timestamp).toLocaleString()}
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="7" className="text-center py-6 text-gray-500">
                  No complaints available.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default ComplaintsTable;
